@raphaelvarane of Manchester United went to the Real Madrid training center for the last goodbye wearing a rare @patekphilippe Calatrava ‘Skeleton’ 5180/1R in 18k rose gold. This timepiece is the first-ever Patek Philippe skeletonized watch. Powered by the famous ultra-thin self-winding caliber 240 movement, which celebrated its 40th anniversary in 2017, this masterpiece is also decorated and engraved by hand. #PatekPhilippe

Retail price: $ 102,850.00

Photo: @realmadrid | @patekphilippe
